    false,nt"url": null,nt"notes": "The fishery resources at Rocky Mountain
    Arsenal (RMA) have been managed by the US Fish and Wildlife Service since the early
    1960's. Management activities included annual surveys, fish stocking, weed control,
    rough fish eradication, lake dredging and construction, and more recently, environmental
    contaminant investigations. It is the goal of the fishery management program at
    the Arsenal to sustain this quality fishery within the constraints of the Army's
    mission at the facility--contaminant cleanup, protection and enhancement of wildlife
    populations, and enhancement of public use opportunities. This document will briefly
    describe some possible fishery management scenarios for the RMA in light of changes
    that are sure to occur as contaminant cleanup efforts get underway.",nt"owner_org":
